CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `sp_asistencia` (IN `numero` INT, IN `fecha_a` VARCHAR(50), IN `fecha_b` VARCHAR(50))   BEGIN

   select clientes.cedula as cedula ,nombres as nombres,apellidos as apellidos,date AS fecha
    from clientes, asistencia
    where clientes.cedula = asistencia.cedula
    and asistencia.cedula = numero
	and date >= fecha_a and date <= fecha_b;
END$$

CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `sp_ficha` (IN `ci` INT)   begin
select id_ficha,clientes.cedula,clientes.nombres,clientes.apellidos,nivel_cliente,peso,cintura,cadera,grasa_corporal,imc,imc_cintura_altura,masa_magra,sobrepeso
from clientes,fichaseguimiento
where clientes.cedula = fichaseguimiento.cedula and
		clientes.cedula = ci
        order by id_ficha desc;
end$$

CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `sp_pagos` (IN `ci` INT)   begin
select membresia.id_membresia,pagos.id_pago,clientes.cedula,clientes.nombres,clientes.apellidos,tipo.tipo,date_ini,date_end,pagos.Total
from clientes,membresia,tipo,pagos
where clientes.cedula = membresia.cedula
	and clientes.cedula = pagos.cedula
	and tipo.id_tipo = membresia.id_tipo
	and membresia.id_membresia = pagos.id_membresia
	and clientes.cedula = ci order by  id_pago desc limit 1;
end$$

